import * as React from 'react';
import { Text, View, StyleSheet, TextInput, Button, TouchableOpacity, NavigatingContainer, ImageBackground } from 'react-native';
import AsyncStorage from '@react-native-async-storage/async-storage';



export default function HomeView({ navigation }) {
    const getData = async () => {
        try {
          const value = await AsyncStorage.getItem('test')
          if(value !== null) {
            console.log('value from home: ', value);
          }
        } catch(e) {
          // error reading value
        }
      }
      getData()


    return(
    <ImageBackground
    source={require("../homebg.png")}
    resizeMode="cover"
    style={styles.image}>
    <View style={styles.container}>
            <Text style={styles.paragraph}>
            Swiftoff 
            </Text>


            <View style={styles.fixToText}>
                <TouchableOpacity
                    title=""
                    color="purple"

                    onPress={() => navigation.replace("QRCode") }
                    style={styles.roundButton1}>


                    <Text style={styles.roundButton13}>
                        Scan QR Code


                    </Text>

                </TouchableOpacity>



            </View>

        </View>
    </ImageBackground>


    )

}


const styles = StyleSheet.create({
    container: {
      flex: 0,
      justifyContent: "center",

      backgroundColor: "",
      paddingTop: 0,
      top: '30%',
    },

    container2: {
      flex: 1,
      zIndex: 1,
      justifyContent: "center",

      backgroundColor: "",
      padding: 8,
    },

    paragraph: {
      margin: 24,
          fontSize: 70,
          fontWeight: 'bold',
          textAlign: 'center',
          color: "white",
    },
    input: {
      height: 40,
      margin: 12,
      borderWidth: 1,
      borderWidth: 1,
      borderRadius: 15,
      padding: 10,
      width: 400,

      alignSelf: "center",
    },

    fixToText: {
      alignSelf: "center",
      width: 200,
      borderRadius: 15,
      paddingTop: 0,

    },

    roundButton1: {
      width: 200,
      height: 48,
      justifyContent: "center",
      alignItems: "center",
      alignSelf: "center",
      padding: 10,
      borderRadius: 25,

      backgroundColor: "rgb(239,139,118)",
    },

    roundButton2: {
      width: 200,
      height: 50,
      paddingTop: 0,
      justifyContent: "center",
      alignItems: "center",
      alignSelf: "center",
      padding: 0,
      borderRadius: 25,

      backgroundColor: "rgb(239,139,118)",
    },
    // SignPainter- HouseScript 98.0
    roundButton13: {
      fontSize: 20,
      color: "white",
    },
    roundButton14: {
      fontSize: 20,
      color: "white",
    },
    input2: {
      height: 40,
      margin: 12,
      borderWidth: 0,
      borderWidth: 0,
      borderRadius: 15,
      padding: 10,
      width: 400,
      fontSize: 16,
      textAlign: "center",
      color: "red",

      alignSelf: "center",
    },
    image2: {
      width: global.windowWidth,
      height: global.windowHeight,
      justifyContent: "center",
      alignSelf: "center",
      flex: 1,
      justifyContent: "center",
    },
    image: {
      flex: 1,
      justifyContent: "center",
    },

    overlay: {
      justifyContent: "center",
      alignItems: "center",
      alignSelf: "center",
      position: "absolute",
      top: 90,
      right: 0,
      bottom: 0,
      left: 0,

      opacity: 1,
    },
  });
